import * as React from 'react';
import { AppProvider } from '@toolpad/core/AppProvider';
import { SignInPage } from '@toolpad/core/SignInPage';
import { useTheme } from '@mui/material/styles';

const providers = [{ id: 'credentials', name: 'Credentials' }];

const BRANDING = {
  logo: (
    <img
      src="https://mui.com/static/logo.svg"
      alt="MUI logo"
      style={{ height: 24 }}
    />
  ),
  title: 'Créer un nouvel utilisateur',
};

const signUp = async (provider, formData) => {
  const promise = new Promise((resolve) => {
    setTimeout(() => {
      const email = formData?.get('email');
        const password = formData?.get('password');
        const Prénom = formData?.get('String');
        const Nom = formData?.get('String');
      console.log(`Creating user with ${provider.name}: ${email}, ${password}`);
      resolve({
        type: 'CredentialsSignup',
        error: null,
      });
    }, 500);
  });
  return promise;
};

export default function CreerUtilisateur() {
  const theme = useTheme();
  return (
    <AppProvider branding={BRANDING} theme={theme}>
      <SignInPage
        signIn={signUp}
        providers={providers}
        slotProps={{ emailField: { autoFocus: false } }}
        mode="signup"
      />
    </AppProvider>
  );
}
